INSERT INTO `berita` (`id_berita`, `link_berita`, `judul`, `isi_berita`, `id_pakar`, `tanggal_berita`, `gambar`, `status_postingan`) VALUES
(1, '7-Hal-Sederhana-Yang-Harus-Diperhatikan', '7 Hal Sederhana Yang Harus Diperhatikan Sebelum Pergi Liburan Musim Dingin. Penting Banget!', '<figure class=\"easyimage easyimage-full\">\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Liburan musim dingin adalah salah satu hal keren yang ingin dicoba oleh para travelers sejati. Entah itu liburan musim dingin nya di wilayah Eropa, di negri sakura, ataupun di wilayah lain, tentu akan selalu ada hal-hal yang harus dipersiapkan sebelum benar-benar pergi liburan.</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Kamu ingin pergi liburan musim dingin dalam waktu dekat? Kalau begitu, setidaknya 7 hal sederhana berikut harus kamu persiapkan ya! List lengkapnya lansung disimak yuk!</span></span></p>\r\n\r\n<div style=\"page-break-after:always\"><span style=\"display:none\">&nbsp;</span></div>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong>1. Kesehatan Diri Sebelum Benar-Benar Pergi Ke Luar Negeri, Agar Tidak Mengganggu Serunya Moment Liburanmu Nanti</strong></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"1880\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Kalau Perlu, Cek Ke Dokter Juga Ya! http://google.com</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Bagaimanapun juga, kesehatan adalah hal berharga yang harus selalu dijaga. Meskipun begitu, nyatanya ada saja travelers yang cuek dengan kondisi kesehatan badan nya, selama berlibur ke sudut-sudut nusantara.</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Meskipun selama ini kamu yang cuek mungkin merasa baik-baik saja, namun untuk moment liburan ke luar negeri selama musim dingin harus sedikit lebih waspada deh! Kondisi disana nanti amat kontras dengan yang biasa ditemui di Indonesia loh! Suhunya saja ekstra dingin, mendekati 0 derajat Celcius!</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Kalau sudah tau gambaran kondisi tadi, kamu yang sering sakit-sakitan selama perjalanan yakin bisa cuek terus seperti itu? Tentu tidak kan? Yuk perhatikan kesehatan dirimu sendiri! Daripada nanti repotnya di negeri orang juga kan?</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong>2. Pakaian Yang Akan Kamu Masukan Kedalam Koper Itu Penting Banget Untuk Diperhatikan Loh! Pilih Yang Tebal Dan Menghangatkan!</strong></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"750\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Keren, Nyaman, Menghangatkan! https://web.facebook.com/</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Saat kamu menonton film, mungkin kamu pernah melihat gaya pakaian yang digunakan saat musim dingin. Dan kebanyakan adalah pakaian tebal, dan tak jarang pula dipakai secara berlapis-lapis.</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Hal tersebut tentu dilakukan bukan tanpa tujuan. Ingat, musim dingin disana suhunya bisa sangat ekstrim loh! Dan biasanya, berada di kisaran angka 5 derajat Celcius bila sedang dalam kondisi normal.</span></span></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong>3. Aksesoris Yang Mungkin Akan Kamu Kenakan Selama Moment Liburan</strong></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"940\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Biar Nyaman Juga Kan? https://www.pexels.com/</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Selain pakaian, aksesoris pun harus turut kamu perhatikan loh! Terlebih bila kamu atau temanmu punya kebiasaan nyentrik menggunakan kalung besi yang bisa teramat dingin saat sedang musim dingin. Kalau tidak diperhatikan kan bisa membahayakan!</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Daripada menggunakan aksesoris nyeleneh semisal tadi, mungkin kamu bisa mulai membiasakan diri menggunakan syal, penghangat telinga, sarung tangan, hingga topi musim dingin! Selain berkhasiat menghangatkan tubuh, kamu akan jadi terlihat lebih keren loh!</span></span></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong>4. Pelembab, Dan Obat Pribadi Dari Yang Sifatnya Ringan Hingga Mendesak</strong></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"750\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Mencegah Lebih Baik Dari Mengobati!&nbsp; https://ketahui.com</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Cuaca dingin seringkali membuat kulit menjadi lebih kering dan rentan mengalami pecah-pecah. Sekalipun kamu seorang pria, tidak ada salahnya loh bila kamu menyiapkan pelembab bibir, wajah, dan tubuh! </span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Kemudian, meskipun beberapa negara di luar negeri memberikan fasilitas kesehatan gratis bagi siapapun yang membutuhkan, nyatanya berobat di luar negeri tidak sesederhana yang terdengar selama ini loh!</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Pergi ke dokter dikala sakit memang sebuah keharusan. Namun selama kamu sudah mengetahui daftar penyakit yang bisa menyerang tiba-tiba, tentu tidak ada salahnya bila kamu mempersiapkan obat pribadi di koper ataupun tas mini yang biasa kamu bawa kemana-mana.</span></span></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong>5. Keadaan Lingkungan Sekitar Area Destinasi Wisata</strong></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"940\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:left\"><br />\r\nKalau Aman, Pasti Lebih Seru! https://ketahui.com</p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Adalah hal yang wajar bila kita meneliti terlebih dahulu tentang keadaan lingkungan sekitar area wisata sebelum benar-benar memutuskan bahwa kita ingin pergi ke sana. Terlebih bila sekitar lokasi memiliki potensi terserang cuaca buruk ataupun kondisi alam lain.</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Daripada kerepotan dengan hal-hal yang berada di luar dugaan, lebih baik kita meneliti terlebih dahulu hal-hal seputar lingkungan sekitar area destinasi wisata bukan?</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Memang, terkadang menghadapi hal yang tidak terduga itu menambah pengalaman. Namun bila dapat mempersiapkan segala sesuatunya dengan lebih baik, pasti lebih asyik!</span></span></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong>6. Ketersediaan Penginapan Yang Sesuai Dengan Harapan</strong></span></span></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"940\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Tak Perlu Mewah, Yang Penting Nyaman! https://web.facebook.com/</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Ingin berlibur ke luar negeri? Penginapan nya sudah dipesan belum? Ingat, mencari penginapan di luar negeri itu tidaklah mudah loh! Daripada nanti pusing sendiri, lebih baik memesan penginapan dari jauh-jauh hari. Toh sekarang juga sudah ada internet yang memudahkan bukan?</span></span></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong>7. Moda Transportasi Umum Yang Bisa Kamu Gunakan Di Negara Tujuan</strong></span></span></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"940\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Cari Yang Paling Efisien! https://www.pexels.com/</span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Menyewa kendaraan untuk dipakai berlibur selama di luar negeri? Memang tidak memakan biaya? Kalau ingin menghemat budget liburan, lebih baik naik transportasi umum saja! Namun, jenis transportasi yang ada di luar negeri tidak akan sama persis dengan apa yang ada di Indonesia ya! </span></span></p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Sebagian negara mungkin memiliki moda transportasi yang cukup lengkap. Namun untuk beberapa lokasi tertentu yang masih terasa nuansa tradisionalnya, moda transportasi yang tersedia tidaklah sebanyak yang kamu perkirakan. Kalaupun ada, mungkin biayanya juga lebih mahal dari yang ada di Indonesia. Untuk itu, perhatikan hal ini dengan baik sebelum berlibur ke luar negeri ya! </span></span></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Oke, itulah tadi 7 hal sederhana yang harus diperhatikan sebelum pergi liburan musim dingin. Merasa terbantu dengan artikel kami? Share ke media sosialmu yuk! Terimakasih banyak ya!</span></span></p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n\r\n<p style=\"text-align:left\">&nbsp;</p>\r\n</figure>\r\n', 1, '2019-01-01', '1.jpeg', 'Active');
INSERT INTO `berita` (`id_berita`, `link_berita`, `judul`, `isi_berita`, `id_pakar`, `tanggal_berita`, `gambar`, `status_postingan`) VALUES
(2, 'Mengenal-Sejarah-Dan-Kelezatan-Oden', 'Mengenal Sejarah, Dan Kelezatan Oden. Menu Makanan Khas Musim Dingin Jepang', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Berlibur ke Jepang saat moment liburan musim dingin? Mengapa tidak? Disana, ada banyak hal seru loh yang menanti! Dan lagi, suasana Jepang di moment musim dingin pastilah berbeda dengan situasi saat musim panas ataupun di musim gugurnya. Meskipun dingin, ada oden kok, si menu makanan khas musim dingin Jepang yang mampu menggoyang lidah.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Travel Mates pernah mencicipi Oden saat pergi berlibur ke Jepang? Bila sudah pernah, pasti tau tentang cita rasanya yang sederhana namun menghangatkan! Tapi, bilapun masih belum tau, Travel Mates tidak perlu merasa minder kok! Toh tidak semua orang tau tentang menu makanan khas musim dingin Jepang yang satu ini. Terlebih bagi mereka yang masih asing dengan hal-hal yang berbau Jepang.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Penasaran dengan citarasa Oden? Cicipi saja langsung di negara asalnya! Namun bila ingin terlebih dahulu mengenal sejarah dan kelezatan Oden, Travel Mates bisa kok menyimak artikel dari tim <a href=\"https://www.his-travel.co.id/\" style=\"color:#0563c1; text-decoration:underline\">H.I.S Travel Indonesia</a> ini terlebih dahulu! Langsung saja disimak yuk! Selamat menyimak ya!</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong>Semua Ini Berawal Dari &ldquo;Dengaku&rdquo;, Sate Tahu Si Cikal Bakal Oden</strong></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"850\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">https://www.fun-japan.jp/</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Jepang memang memiliki banyak hal. Dari masa ke masa, Dengaku dikenal sebagai tarian dan nyanyian yang dilakukan dengan paduan ritme drum taiko dan nada seruling yang didendangkan di moment musim tanam demi mengharap panen yang melimpah.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Konon, menurut sebagian masyarakat di masa lalu, wujud tarian ini amat mirip dengan tahu yang disate kemudian dibakar. Seiring dengan waktu, guna mempermudah penyebutan, makanan yang satu inipun disebut Oden, yang asal kata mulanya De-n-ga-ku tadi diberi imbuhan O di awal kata nya.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Setelah itu, masyarakat jepang pun perlahan mengenal cara pembuatan dengaku yag dipadukan dengan bumbu miso hasil fermentasi kedelai, dan terus bertambah sedari zaman edo (sekitar 1603-1867). Hasilnya, isian Oden inipun tidak hanya sekedar tahu saja. Melainkan juga ada terong, talas, varian olahan tahu, bakso, olahan ikan, serta umbi konyaku yang kesemuanya lezat-lezat!</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong>Oden, Si Menu Maknan Khas Musim Dingin Jepang Yang Kelahiran Oden Rebusnya Sejalan Dengan Kepopuleran Pembuatan Kecap Shoyu</strong></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"850\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">https://www.fun-japan.jp/</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Di zaman awal perkembangan makanan khas Jepang yang satu ini, Oden mengalami beberapa penyesuaian disana-sini. Tentu ini mengikuti kebiasaan masyarakat setempat dan selera masing-masing orang yang membuat menu panganan ini.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Meskipun begitu, nyatanya semuanya memiliki pola yang hampir mirip. Banyak yang beranggapan bahwa Dengaku yang awalnya merupakan sate tahu bakar ini, akhirnya dimasak secara berkuah karena banyaknya produsen kecap shoyu di kota Chosi dan kota Nado di prefektur Chiba. Konon, masyarakat setempat lebih suka memasak Oden dengan cara direbus sehingga menyisakan kuah yang juga diberi bumbu kecap shoyu.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Bila menilik sejarah lebih jauh lagi, pemberian kuah ini sendiri sudah berlangsung sejak zaman Meiji (1868-1912). Dan kuah ini pun semakin diwajibkan kehadirannya sejak zaman Taisho (1912-1926), terlebih di wilayah Kansai.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Uniknya, orang Kansai sendiri pada masa itu tidak begitu mengenal Oden. Penyebabnya, hidangan hangat yang satu ini lebih dikenal dengan sebutan &ldquo;Kato-ni&rdquo; yang dalam artian berarti masakan rebusan dari daerah Kanto Jepang. Orang Kanto ternyata berani beda ya Travel Mates?</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong>Sebelum Menjadi Masakan Rumahan, Menu Makanan Khas Musim Dingin Jepang Ini Hanya Dianggap Sebagai Masakan Warung Saja Loh!</strong></span></span></p>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"850\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">https://www.fun-japan.jp/</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Bukan hal yang aneh bila ada menu makanan tertentu yang memang dianggap menu makanan warung oleh masyarakat. Seperti halnya Oden, yang pada masa awal mula kemunculannya, menu masakan ini sudah mendapat label menu masakan warung.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Terlebih bila mengingat fakta bahwa pusat perbelanjaan di masa lalu belum menjual bumbu kuah oden dan bahan isiannya. Menyantap Oden dulu terasa lebih spesial dari era sekarang.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Meskipun begitu, nyatanya Oden yang dibuat di warung tetap memiliki keistimewaan yang tersendiri kok! Bagi para turis seperti kita, pembuat Oden yang juga kerap menjual ramen di pinggiran jalan ini merupakan penyelamat rasa penasaran akan citarasanya yang konon sudah terkenal! Harganya pun tidak begitu mahal, hanya berkisar 90 hingga 150 yen saja kok per isiannya!</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Namun, bilapun Travel Mates memang memiliki kenalan di Jepang dan ingin membuat Oden, bisa kok membuatnya sendiri. Tenang, seperti yang kami bilang tadi, bahan dan bumbu sudah tersedia lengkap di minimarket tertentu!</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong>Cara Membuat Oden Dan Menikmati Menu Makanan Khas Musim Dingin Jepang Yang Satu Ini</strong></span></span></p>\r\n\r\n<figure class=\"easyimage easyimage-full\"><img alt=\"\" src=\"data:image/jpeg;base64,\" width=\"850\" />\r\n<figcaption></figcaption>\r\n</figure>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">https://www.fun-japan.jp/</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Pembuatan Oden ternyata sesederhana cara menikmatinya. Anda tinggal membuat kaldu dari bahan rumput laut dan ikan cakalang, kemudian masukan bahan-bahan isian oden ke dalam kuah rebusan. Namun tentunya, memasukan bahan isian ini tidak bisa sembarangan ya!</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Lebih baik Travel Mates memasukan terlebih dahulu bahan-bahan yang memerlukan waktu lama untuk matang semisal lobak, telur, dan lain sebagainya ke dalam panik. Baru setelah itu, kamu bisa menambahkan makanan yang mudah hancur seperti tahu ikan, tahu isi, dan sebagainya sebelum melanjutkan proses memasak dengan api kecil.</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Ingin bumbu kaldu dari kuah oden cepat meresap ke bahan isian? Buat saja guratan kecil di bahan isian Oden yang kamu masukan! Cara ini terbukti ampuh loh!</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\">Oke, itulah tadi artikel singkat kami tentang mengenal sejarah, dan kelezatan Oden. Menu makanan khas musim dingin Jepang. Bagaimana? Kamu tertarik untuk mencicipi hidangan lezat yang satu ini secara langsung di Jepang? Bila Travel Mates tertarik, segera rencanakan liburan ke jepang bersama <a href=\"https://www.his-travel.co.id/\" style=\"color:#0563c1; text-decoration:underline\">H.I.S Travel Indonesia</a> yuk! Sampai jumpa di moment selanjutnya, terimakasih sudah menyimak ya!</span></span></p>\r\n', 1, '2019-01-02', 'oden-makanan-khas-musim-dingin-jepang-2.jpg', 'Active');

