INSERT INTO `penyakit` (`id_penyakit`, `nama_penyakit`, `definisi_solusi`) VALUES
('K1', 'Kecemasan Ringan Sebentar', '<p><strong>DIKENAL SEBAGAI</strong><br />\r\nSalah satu dari jenis kecemasan yang didefinisikan oleh Kartono Kartini.<br />\r\n<br />\r\n<strong>PENJELASAN SINGKAT</strong><br />\r\nKecemasan ringan merupakan bentuk rasa cemas yang sifatnya tidak menimbulkan trauma. Meskipun begitu, sebagai Mahasiswa Tingkat Akhir kamu perlu mengantisipasi serangan kecemasan jenis ini sedari dini, agar tidak menyebabkan gangguan di kemudian hari.<br />\r\n<br />\r\nMeskipun beresiko mengganggu, pada dasarnya kecemasan ini sangat bermanfaat bagi perkembangan kepribadian seseorang, karena kecemasan ini dapat menjadi suatu tantangan bagi seorang individu untuk mengatasinya.<br />\r\n<br />\r\nKecemasan ringan yang muncul sebentar adalah suatu kecemasan yang wajar terjadi padaindividu akibat situasi-situasi yang mengancam dan individu tersebut kurang mampu mengatasinya, sehingga timbul kecemasan.<br />\r\n<br />\r\n<br />\r\n<strong>CIRI-CIRI</strong></p>\r\n\r\n<ul>\r\n	<li>Mengalami kecemasan (Anxiety) yang sifatnya tidak traumatis.</li>\r\n	<li>Mampu mengendalikan diri saat sedang mengalami kecemasan.</li>\r\n	<li>Mengalami kecemasan yang sifatnya tidak berulang.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>SARAN PENANGANAN</strong></p>\r\n\r\n<p>Kecemasan Ringan Sebentar adalah kecemasan yang relatif umum, dan pernah dirasakan oleh hampir semua orang. Oleh karenanya, sebagai Mahasiswa tingkat akhir, kamu dapat sedikit bernafas lega.</p>\r\n\r\n<p>Untuk menanggulangi kecemasan Ringan Sebentar ini, kamu dapat melakukan hal-hal semisal berikut ini:</p>\r\n\r\n<ul>\r\n	<li>Belajarlah untuk mengenal dirimu sendiri agar tidak ada keraguan yang mencemaskanmu</li>\r\n	<li>Biasakan diri untuk senantiasa berfikiran positif terhadap segala hal yang terjadi dalam kehidupan yang kamu jalani.</li>\r\n	<li>Berlatihlah untuk menenangkan dirimu ketika sedang merasakan kecemasan.</li>\r\n	<li>Perkuat keimanan terhadap kebaikan tuhan akan membantumu dalam meredam rasa kecemasan yang kamu miliki hingga ke titik nol.</li>\r\n	<li>Bilapun merasakan cemas yang berlebih, konsultasikan dengan teman yang baik, orang tua, hingga ke tenaga medis dibidang psikiatri terdekat.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>HAL YANG HARUS DIHINDARI</strong></p>\r\n\r\n<ul>\r\n	<li>Berfikiran negatif yang dapat mendatangkan rasa cemas.</li>\r\n	<li>Lingkaran pergaulan yang sering membuatmu merasa cemas.</li>\r\n	<li>Merasa putus asa dan lupa menenangkan diri.</li>\r\n	<li>Terus memikirkan hal yang membuatmu merasa cemas.</li>\r\n	<li>Berkonsultasi tentang kecemasanmu kepada orang yang salah.</li>\r\n</ul>\r\n'),
('K2', 'Kecemasan Ringan Lama ', '<p><strong>DIKENAL SEBAGAI</strong><br />\r\nSalah satu dari jenis kecemasan yang didefinisikan oleh Kartono Kartini.<br />\r\n<br />\r\n<strong>PENJELASAN SINGKAT</strong><br />\r\nKecemasan ringan merupakan bentuk rasa cemas yang sifatnya tidak menimbulkan trauma. Meskipun begitu, sebagai Mahasiswa Tingkat Akhir kamu perlu mengantisipasi serangan kecemasan jenis ini sedari dini, agar tidak menyebabkan gangguan di kemudian hari.<br />\r\n<br />\r\nMeskipun beresiko mengganggu, pada dasarnya kecemasan ini sangat bermanfaat bagi perkembangan kepribadian seseorang, karena kecemasan ini dapat menjadi suatu tantangan bagi seorang individu untuk mengatasinya.<br />\r\n<br />\r\nKecemasan ringan yang tergolong lama, biasanya muncul dari endapan kecemasan ringan sebentar yang terlalu lama tidak ditangani. Biasanya, kecemasan ini akan memunculkan efek berulang kepada para penderitanya. Sehingga, individu yang menderita kecemasan jenis ini akan lebih sering merasakan kecemasan yang sama hingga ia mampu untuk mengatasi permasalahan tersebut.<br />\r\n<br />\r\n<br />\r\n<strong>CIRI-CIRI</strong></p>\r\n\r\n<ul>\r\n	<li>Mengalami kecemasan (Anxiety) yang sifatnya tidak traumatis.</li>\r\n	<li>Mampu mengendalikan diri saat sedang mengalami kecemasan.</li>\r\n	<li>Mengalami kecemasan yang sifatnya berulang.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>SARAN PENANGANAN</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kecemasan Ringan Lama adalah kecemasan merupakan endapan dari kecemasan Ringan Sebentar yang terus berulang dan tidak mendapatkan penanganan. Oleh karenanya, sebagai Mahasiswa tingkat akhir, kamu harus mengatasi kecemasan yang kamu rasakan agar dapat kembali bernafas lega.</p>\r\n\r\n<p>Untuk menanggulangi kecemasan Ringan Lama ini, kamu dapat melakukan hal-hal semisal berikut ini:</p>\r\n\r\n<ul>\r\n	<li>Evaluasi diri tentang sejauh mana kamu mengenal dirimu sendiri, dan hilangkan segala bentuk keraguan yang mencemaskanmu</li>\r\n	<li>Berlatihlah untuk menenangkan dirimu ketika sedang merasakan kecemasan, terlebih bila kecemasan tersebut sudah datang berulang kali.</li>\r\n	<li>Biasakan diri untuk senantiasa berfikiran positif terhadap segala hal yang terjadi dalam kehidupan yang kamu jalani.</li>\r\n	<li>Perkuat keimanan terhadap kebaikan tuhan akan membantumu dalam meredam rasa kecemasan dan mencegahnya terjadi secara berulang-ulang.</li>\r\n	<li>Bilapun merasa kesulitan untuk menanganinya, konsultasikan dengan teman yang baik, orang tua, hingga ke tenaga medis dibidang psikiatri terdekat.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>HAL YANG HARUS DIHINDARI</strong></p>\r\n\r\n<ul>\r\n	<li>Berfikiran negatif yang dapat mendatangkan rasa cemas.</li>\r\n	<li>Lingkaran pergaulan yang sering membuatmu merasa cemas.</li>\r\n	<li>Merasa putus asa dan lupa menenangkan diri.</li>\r\n	<li>Terus memikirkan hal yang membuatmu merasa cemas.</li>\r\n	<li>Berkonsultasi tentang kecemasanmu kepada orang yang salah.</li>\r\n</ul>\r\n'),
('K3', 'Kecemasan Berat Sebentar', '<p><strong>DIKENAL SEBAGAI</strong><br />\r\nSalah satu dari jenis kecemasan yang didefinisikan oleh Kartono Kartini.<br />\r\n<br />\r\n<strong>PENJELASAN SINGKAT</strong><br />\r\nKecemasan berat adalah kecemasan yang terlalu berat dan berakar secara mendalam dalam diriseseorang. Apabila seseorang mengalami kecemasan semacam ini maka biasanya ia tidak dapat mengatasinya.&nbsp;<br />\r\n<br />\r\nKecemasan ini mempunyai akibat menghambat atau merugikan perkembangan kepribadian seseorang. Kecemasan ini dibagi menjadi dua yaitu kecemasan berat yang sebentar dan lama.<br />\r\n<br />\r\nKecemasan yang berat tetapi munculnya sebentar dapat menimbulkan traumatis pada individu jika menghadapi situasi yang sama dengan situasi penyebab munculnya kecemasan.&nbsp;<br />\r\n<br />\r\n<br />\r\n<strong>CIRI-CIRI</strong></p>\r\n\r\n<ul>\r\n	<li>Mengalami kecemasan (Anxiety) yang sifatnya traumatis.</li>\r\n	<li>Mampu mengendalikan diri saat sedang mengalami kecemasan.</li>\r\n	<li>Saat sedang dilanda kecemasan, cenderung sulit untuk mengendalikan diri.</li>\r\n	<li>Masih dapat dinyatakan sehat secara fisik.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>SARAN PENANGANAN</strong></p>\r\n\r\n<p>Kecemasan berat adalah kecemasan yang dapat dialami oleh siapa saja yang kesulitan untuk mengatasi kecemasan yang ia rasakan, termasuk juga mereka yang sedang berstatus sebagai Mahasiswa Tingkat Akhir. Karena kecemasan berat dapat mengganggu keseharian, sebagai Mahasiswa tingkat akhir, kamu harus mewaspadai jenis kecemasan ini.</p>\r\n\r\n<p>Untuk menanggulangi kecemasan Berat Sebentar ini, kamu dapat melakukan hal-hal semisal berikut ini:</p>\r\n\r\n<ul>\r\n	<li>Belajarlah untuk mengenal dirimu sendiri agar tidak ada keraguan yang mencemaskanmu</li>\r\n	<li>Biasakan diri untuk senantiasa berfikiran positif terhadap segala hal yang terjadi dalam kehidupan yang kamu jalani.</li>\r\n	<li>Berlatihlah untuk menenangkan dirimu ketika sedang merasakan kecemasan.</li>\r\n	<li>Perkuat keimanan terhadap kebaikan tuhan akan membantumu dalam meredam rasa kecemasan.</li>\r\n	<li>Sering berkonsultasi dengan orang terdekat agar mereka mengetahui kondisimu.</li>\r\n	<li>Kunjungi fasilitas medis yang melayani bidang psikiatri guna mendapatkan perawatan lebih lanjut.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>HAL YANG HARUS DIHINDARI</strong></p>\r\n\r\n<ul>\r\n	<li>Berfikiran negatif yang dapat mendatangkan rasa cemas.</li>\r\n	<li>Lingkaran pergaulan yang sering membuatmu merasa cemas.</li>\r\n	<li>Merasa putus asa dan lupa menenangkan diri.</li>\r\n	<li>Terus memikirkan hal yang membuatmu merasa cemas.</li>\r\n	<li>Berkonsultasi tentang kecemasanmu kepada orang yang salah.</li>\r\n	<li>Lupa dengan hal-hal yang direkomendasikan oleh tenaga psikiatri yang mendiagnosis keluhan yang kamu rasakan.</li>\r\n</ul>\r\n'),
('K4', 'Kecemasan Berat Lama', '<p><strong>DIKENAL SEBAGAI</strong><br />\r\nSalah satu dari jenis kecemasan yang didefinisikan oleh Kartono Kartini.<br />\r\n<br />\r\n<strong>PENJELASAN SINGKAT</strong><br />\r\nKecemasan berat adalah kecemasan yang terlalu berat dan berakar secara mendalam dalam diriseseorang. Apabila seseorang mengalami kecemasan semacam ini maka biasanya ia tidak dapat mengatasinya.<br />\r\n<br />\r\nKecemasan ini mempunyai akibat menghambat atau merugikan perkembangan kepribadian seseorang. Kecemasan ini dibagi menjadi dua yaitu kecemasan berat yang sebentar dan lama.<br />\r\n<br />\r\nKecemasan yang berat tetapi munculnya lama akan merusak kepribadian individu. Hal ini akan berlangsung terus menerus bertahun-tahun dan dapat meruak proses kognisi individu. Kecemasan yang berat dan lama akan menimbulkan berbagai macam penyakit seperti darah tinggi, tachycardia (percepatan darah), excited (heboh, gempar).<br />\r\n<br />\r\n<br />\r\n<strong>CIRI-CIRI</strong></p>\r\n\r\n<ul>\r\n	<li>Mengalami kecemasan (Anxiety) yang sifatnya traumatis.</li>\r\n	<li>Mampu mengendalikan diri saat sedang mengalami kecemasan.</li>\r\n	<li>Saat sedang dilanda kecemasan, cenderung sulit untuk mengendalikan diri.</li>\r\n	<li>Mengalami kecemasan disertai dengan penurunan kondisi aspek kognisi, dan gangguan penyakit semisal darah tinggi ataupun tachycardia (percepatan aliran darah).</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>SARAN PENANGANAN</strong></p>\r\n\r\n<p>Kecemasan berat adalah kecemasan yang dapat dialami oleh siapa saja yang kesulitan untuk mengatasi kecemasan yang ia rasakan, termasuk juga mereka yang sedang berstatus sebagai Mahasiswa Tingkat Akhir. Karena kecemasan berat dapat mengganggu keseharian, sebagai Mahasiswa tingkat akhir, kamu harus mewaspadai jenis kecemasan ini.</p>\r\n\r\n<p>Untuk menanggulangi kecemasan Berat Lama ini, kamu dapat melakukan hal-hal semisal berikut ini:</p>\r\n\r\n<ul>\r\n	<li>Kurangi kesibukan sesegera mungkin dan fokuslah untuk menjalani pengobatan.</li>\r\n	<li>Kunjungi fasilitas medis yang melayani bidang psikiatri guna mendapatkan perawatan lebih lanjut.</li>\r\n	<li>Belajarlah untuk mengenal dirimu sendiri agar tidak ada keraguan yang mencemaskanmu</li>\r\n	<li>Biasakan diri untuk senantiasa berfikiran positif terhadap segala hal yang terjadi dalam kehidupan yang kamu jalani.</li>\r\n	<li>Berlatihlah untuk menenangkan dirimu ketika sedang merasakan kecemasan.</li>\r\n	<li>Perkuat keimanan terhadap kebaikan tuhan akan membantumu dalam meredam rasa kecemasan.</li>\r\n	<li>Sering berkonsultasi dengan orang terdekat agar mereka mengetahui perkembangan kondisimu.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>HAL YANG HARUS DIHINDARI</strong></p>\r\n\r\n<ul>\r\n	<li>Berfikiran negatif yang dapat mendatangkan rasa cemas.</li>\r\n	<li>Lingkaran pergaulan yang sering membuatmu merasa cemas.</li>\r\n	<li>Merasa putus asa dan lupa menenangkan diri.</li>\r\n	<li>Terus memikirkan hal yang membuatmu merasa cemas.</li>\r\n	<li>Berkonsultasi tentang kecemasanmu kepada orang yang salah.</li>\r\n	<li>Lupa dengan hal-hal yang direkomendasikan oleh tenaga psikiatri yang mendiagnosis keluhan yang kamu rasakan.</li>\r\n</ul>\r\n'),
('M1', 'Kecemasan Rasional ', '<p><strong>DIKENAL SEBAGAI</strong><br />\r\nSalah satu dari jenis kecemasan yang didefinisikan oleh Mustamir Pedak.<br />\r\n<br />\r\n<strong>PENJELASAN SINGKAT</strong><br />\r\nMerupakan suatu ketakutan akibat adanya objek yang memang mengancam, misalnya ketika menunggu hasil ujian. Ketakutan ini dianggap sebagai suatu unsur pokok normal dari mekanisme pertahanan dasariah kita.<br />\r\n<br />\r\n<strong>CIRI-CIRI</strong></p>\r\n\r\n<ul>\r\n	<li>Merasakan indikasi adanya kecemasan (Anxiety).</li>\r\n	<li>Mengalami rasa cemas yang mudah untuk diketahui penyebabnya. Misal, rasa cemas setelah menghadapi ujian, tes, atau tahapan proses seleksi tertentu.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>SARAN PENANGANAN</strong></p>\r\n\r\n<p>Kecemasan rasional adalah kecemasan yang relatif umum, dan pernah dirasakan oleh hampir semua Mahasiswa. Oleh karenanya, sebagai Mahasiswa tingkat akhir, kamu dapat sedikit bernafas lega.</p>\r\n\r\n<p>Untuk menanggulangi kecemasan Rasional ini, kamu dapat melakukan hal-hal semisal berikut ini:</p>\r\n\r\n<ul>\r\n	<li>Sebelum menghadapi ujian, persiapkan diri dengan mengulang semua materi yang ingin diujikan.</li>\r\n	<li>Ketika mengulang materi, biasakan juga mengadakan beberapa simulasi ujian yang bisa kamu lakukan secara mandiri untuk membantumu dalam menngetahui level kemampuanmu.</li>\r\n	<li>Buat persiapan sematang mungkin, agar kamu merasa lebih yakin dengan level kemampuanmu.</li>\r\n	<li>Saat sedang ujian, fokus terhadap materi yang diujikan. Kerjakan sebaik mungkin, dan mulailah dari hal yang paling mudah.</li>\r\n	<li>Tetap jaga kepercayaan dirimu, bahkan setelah meninggalkan ruang ujian. Ini penting agar kamu tetap terhindar dari rasa cemas yang dapat menyerangmu sewaktu-waktu.</li>\r\n	<li>Bila terlanjur merasakan cemas, tetap yakinkan dirimu bahwa kamu telah melakukan segala yang terbaik.</li>\r\n	<li>Tetap berfikiran positif, dan senantiasa ingat akan segala rencana baik dari Tuhan Yang Maha Esa untuk masa depan cerah yang kamu miliki.</li>\r\n	<li>Bilapun merasakan cemas yang berlebih, konsultasikan dengan teman yang baik, orang tua, hingga ke tenaga medis dibidang psikiatri terdekat.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>HAL YANG HARUS DIHINDARI</strong></p>\r\n\r\n<ul>\r\n	<li>Berfikiran negatif yang dapat mendatangkan rasa cemas.</li>\r\n	<li>Lingkaran pergaulan yang sering membuatmu merasa cemas.</li>\r\n	<li>Merasa putus asa dan lupa menenangkan diri.</li>\r\n	<li>Terus memikirkan hal yang membuatmu merasa cemas.</li>\r\n	<li>Berkonsultasi tentang kecemasanmu kepada orang yang salah.</li>\r\n</ul>\r\n'),
('M2', 'Kecemasan Irasional', '<p><strong>DIKENAL SEBAGAI</strong><br />\r\nSalah satu dari jenis kecemasan yang didefinisikan oleh Mustamir Pedak.<br />\r\n<br />\r\n<strong>PENJELASAN SINGKAT</strong><br />\r\nMerupakan suatu ketakutan akibat adanya objek nyata ataupun objek khayal yang dirasa mengancam oleh diri sendiri, namun tidak dianggap membahayakan oleh kebanyakan orang.&nbsp;<br />\r\n<br />\r\n<strong>CIRI-CIRI</strong></p>\r\n\r\n<ul>\r\n	<li>Merasakan indikasi adanya kecemasan (Anxiety).</li>\r\n	<li>Sering merasa cemas dengan hal-hal yang sebenarnya sederhana, atau hanya sebatas apa yang ada di dalam khayalan semata. Misal, merasa kurang percaya dengan keamanan kendaraan meskipun sudah tahu bahwa ada petugas keamanan yang berjaga.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>SARAN PENANGANAN</strong></p>\r\n\r\n<p>Kecemasan rasional adalah kecemasan yang cukup unik, dan memiliki ragam jenis pemicu yang cukup banyak. Umumnya, orang yang merasakan kecemasan jenis ini adalah mereka yang memiliki daya imajinasi yang cukup liar.</p>\r\n\r\n<p>Dikarenakan sumber dari kecemasan jenis ini adalah hal-hal yang sebenarnya tidak logis, kamu yang menderita kecemasan Irasional dapat sedikit bernafas lega.</p>\r\n\r\n<p>Untuk menanggulangi kecemasan Irasional ini, kamu dapat melakukan hal-hal semisal berikut ini:</p>\r\n\r\n<ul>\r\n	<li>Kenali dirimu sendiri, dan ketahui tentang seberapa jauh daya imajinasi yang kamu miliki.</li>\r\n	<li>Bedakan antara apa yang kamu sebut imajinasi, dengan fakta yang bisa kamu temukan bila menggunakan fikiran logis.</li>\r\n	<li>Perbanyak membaca buku-buku ilmiah, agar fikiran mu yang gemar berimajinasi tentang hal aneh dapat menjadi terarah dengan lebih baik.</li>\r\n	<li>Pelajari tentang cara untuk menenangkan diri ketika kamu menghadapi situasi fikiran irasional yang membuatmu cemas.</li>\r\n	<li>Yakinkan dirimu sendiri bahwa semua akan baik-baik saja, dan ingatkan dirimu tentang kebaikan Tuhan Yang Maha Esa.</li>\r\n	<li>Bila terlanjur merasakan cemas, tetap yakinkan dirimu bahwa kamu akan mendapatkan hal baik dan bukan sebaliknya.</li>\r\n	<li>Bilapun merasakan cemas yang berlebih, konsultasikan dengan teman yang kamu rasa baik, orang tua, hingga ke tenaga medis dibidang psikiatri terdekat.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>HAL YANG HARUS DIHINDARI</strong></p>\r\n\r\n<ul>\r\n	<li>Berfikiran negatif yang dapat mendatangkan rasa cemas.</li>\r\n	<li>Berimajinasi tentang hal-hal aneh yang bisa mencemaskan dirimu.</li>\r\n	<li>Lingkaran pergaulan aneh yang sering membuatmu merasa cemas.</li>\r\n	<li>Merasa larut dalam dunia imajinasi hingga putus asa dan lupa untuk menenangkan diri.</li>\r\n	<li>Terus memikirkan ingatan yang membuatmu merasa cemas.</li>\r\n	<li>Berkonsultasi tentang kecemasanmu kepada orang yang salah.</li>\r\n</ul>\r\n'),
('M3', 'Kecemasan Fundamental', '<p><strong>DIKENAL SEBAGAI</strong><br />\r\nSalah satu dari jenis kecemasan yang didefinisikan oleh Mustamir Pedak.<br />\r\n<br />\r\n<strong>PENJELASAN SINGKAT</strong><br />\r\nKecemasan fundamental merupakan suatu pertanyaan tentang siapa dirinya, untuk apa hidupnya, dan akan kemanakah kelak hidupnya berlanjut. Kecemasan ini disebut sebagai kecemasan eksistensial yang mempunyai peran fundamental bagi kehidupan manusia.<br />\r\n<br />\r\n<strong>CIRI-CIRI</strong></p>\r\n\r\n<ul>\r\n	<li>Merasakan indikasi adanya kecemasan (Anxiety).</li>\r\n	<li>Sering merasa bingung atau ragu dengan wujud jati diri saat ini, dan sering mencemaskan tentang masa depan terutama yang berkaitan dengan profesi yang ingin digeluti.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>SARAN PENANGANAN</strong></p>\r\n\r\n<p>Kecemasan Fundamental adalah kecemasan yang relatif umum, dan pernah dirasakan oleh hampir semua Mahasiswa. Sebab, setiap orang pasti pernah merasa bingung dengan peran yang ingin ia ambil di dalam kehidupan bermasyarakat.</p>\r\n\r\n<p>Seiring dengan berjalan nya waktu, kecemasan ini biasanya akan pulih secara alami. Penderita kecemasan ini hanya perlu yakin dengan kemampuan yang dimilikinya, dan konsisten dengan jalur yang telah ia pilih. Oleh karenanya, sebagai Mahasiswa tingkat akhir, kamu dapat sedikit bernafas lega.</p>\r\n\r\n<p>Untuk menanggulangi kecemasan Fundamental ini, kamu dapat melakukan hal-hal semisal berikut ini:</p>\r\n\r\n<ul>\r\n	<li>Belajar untuk mengenali apa yang diinginkan oleh diri sendiri, dan menjabarkan apa faktor yang mendasari keinginan tersebut muncul.</li>\r\n	<li>Kenali seberapa besar keinginan untuk menekuni sebuah bidang tertentu.</li>\r\n	<li>Mengikuti program tes penelusuran minat dan bakat yang direkomendasikan oleh banyak orang.</li>\r\n	<li>Yakinkan diri bahwa kamu bisa konsisten dan meraih kesuksesan di bidang yang telah kamu incar meskipun memerlukan waktu.</li>\r\n	<li>Saat sedang merasakan kegagalan, percayalah bahwa sebenarnya itu hanyalah sebuah latihan dan sebentuk kasih sayang Tuhan Yang Maha Esa untuk memperkuat dirimu dimasa depan.</li>\r\n	<li>Tetap jaga kepercayaan dirimu, meskipun kamu bertemu dengan lingkungan yang meremehkan bidang profesimu.</li>\r\n	<li>Bila terlanjur merasakan cemas tentang masa depanmu, tanyakan dirimu kembali tentang apa hal yang membuatmu cemas. Segera tenangkan dirimu dan jangan bertindak secara gegabah.</li>\r\n	<li>Tetap berfikiran positif, dan senantiasa ingat akan segala rencana baik dari Tuhan Yang Maha Esa untuk masa depan cerah yang kamu miliki.</li>\r\n	<li>Bilapun merasakan cemas yang berlebih, konsultasikan dengan teman yang baik, orang tua, hingga ke tenaga medis dibidang psikiatri terdekat.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>HAL YANG HARUS DIHINDARI</strong></p>\r\n\r\n<ul>\r\n	<li>Berfikiran negatif tentang masa depanmu sebelum benar-benar mencoba untuk tetap konsisten selama beberapa waktu.</li>\r\n	<li>Lingkaran pergaulan yang sering membuatmu merasa kurang percaya diri dengan bidang profesimu.</li>\r\n	<li>Merasa putus asa dan lupa menenangkan diri saat merasa cemas tentang masa depanmu.</li>\r\n	<li>Terus memikirkan hal yang membuatmu merasa cemas.</li>\r\n	<li>Berkonsultasi tentang kecemasanmu kepada orang yang salah.</li>\r\n</ul>\r\n'),
('Z1', 'Tidak Ditemukan', '<p><strong>PENJELASAN SINGKAT</strong><br />\r\nSetelah melakukan serangkaian langkah analisis sesuai analisa, sistem tidak bisa menemukan jenis kecemasan yang Anda alami.<br />\r\n<br />\r\nHal ini dikarenakan tidak adanya data inputan yang diberikan, atau data inputan masih dikategorikan ambigu oleh sistem yang memproses pekerjaan.<br />\r\n<br />\r\n<br />\r\n<strong>PENYEBAB HAL INI BISA TERJADI </strong></p>\r\n\r\n<ul>\r\n	<li>Data inputan kurang lengkap.</li>\r\n	<li>Masih terdapat keragu-raguan dalam menginputkan data.</li>\r\n	<li>Kurangnya ketelitian saat mengisikan data inputan.</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>SARAN TERBAIK UNTUK HAL INI</strong></p>\r\n\r\n<ul>\r\n	<li>Lengkapi data inputan!</li>\r\n	<li>Kurangi keragu-raguan saat menginputkan data!</li>\r\n	<li>Lebih teliti lagi saat mengisikan data inputan!</li>\r\n	<li>Berkonsultasi lebih lanjut ke tenaga medis yang dapat menangani problema Anxiety!</li>\r\n</ul>\r\n\r\n<p><br />\r\n<strong>SARAN TAMBAHAN</strong></p>\r\n\r\n<ul>\r\n	<li>Jangan panik!</li>\r\n	<li>Boleh melakukan pemeriksaan lebih dari sekali!</li>\r\n	<li>Jaga komunikasi dengan orang-orang terdekat!</li>\r\n</ul>\r\n');

